INSERT INTO `mu_family_tree` VALUES (1,'穆茂',1,1,0,'明·禀膳生赠宁津主簿','廪膳生（lǐn shàn shēnɡ）即廪生， 明清两代称由公家给以膳食的生员。秀才中的一等是廪生，所谓廪生，就是秀才经过岁考和科考两试成绩优秀者。廪生政府每月给廪食。并有资格被选为贡生。廪生--廪膳生员，科举制度中生员名目之一。明府、州、县学生员最初每月都给廪膳，补助生活。名额有定数，明初府学四十人，州学三十人，县学二十人，每人月给廪米六斗。清沿其制，经岁、科两试一等前列者，方能取得廪名义。名额因州、县大小而异，每年发廪饩银四两。','none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'穆贵',2,4,1,'明·选贡任宁津主簿','选贡是指科举制度中由地方贡入国子监的生员之一种。\n明制，于岁贡之外考选学行俱优者充贡，因有此名。见《明史·选举志一》：“ 弘治中，南京祭酒章懋言：‘……乞於常贡外，令提学行选贡之法，不分廪膳、增广生员，通行考选，务求学行兼优、年富力强、累试优等者，乃以充贡。’”。清定拔贡、优贡之制，亦由此而来。','none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'穆叢(cong)',2,3,1,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'穆锦',2,2,1,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'穆森',2,1,1,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'穆经',3,1,2,'明·麻吏目','吏目\n官名。金朝始置，为首领官。掌案牍和管辖吏员，负责处理官府内部具体公事。元朝沿置，亦为首领官。中下州地方官府中设一至二名，为流外职，任满可升为都目。例由路总管府、府、州司吏考满升入。明朝地方各州设，为州之属官，从九品。明代各州置吏目一人，从九品，掌出纳文书或分领州事；五城兵马司、京卫指挥使司、王府护卫指挥使司、王府仪卫司、都指挥使司、千户所等都设吏目，掌出纳文书之类。见《明史·职官三、四、五》。清朝五城兵马司、太医院、及各州均设吏目，太医院吏目与医士相同，五城兵马司及各州吏目掌管缉捕、守狱及文书等事。','none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'穆宣',3,3,3,'明·岁贡生赠巨鹿教谕','“教谕”宋代在京师设立的小学和武学中的教官。元明清县学皆置教谕，与训导共同负责县学的管理与课业，官为正八品，掌文庙祭拜，教育所属生员。','none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'穆太',3,2,3,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'穆振',3,1,3,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'穆潭',3,3,4,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,'穆兰',3,2,4,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'穆全',3,1,4,'',NULL,'none','MAN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,'穆珣',3,1,5,'明·廪膳生妻薛氏归珣二载珣卒有遗腹孝事姑舅扶子成立寿八十余而终直指吴工生其门事载邑乘',NULL,'none','MAN',NULL,NULL